    "contracts/Drop.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;


import "hardhat/console.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";


contract drop is Ownable, Pausable {

    constructor() {
        treasurer = msg.sender;
        lastDraw = block.timestamp;
        lastWinner = msg.sender;
    }

    IERC20 public tokenAddress; //THIS IS THE TOKEN THAT CAN BE USED TO MINT THE NFT
    uint public rate;
    address treasurer;
    uint lastDraw;
    address[] public players; // List of members
    address public lastWinner;
    mapping(address => uint)public addressToTicket;

    function enter() public {
        tokenAddress.transferFrom(msg.sender, address(this), rate);
        players.push(msg.sender);
        addressToTicket[msg.sender] += 1;
    }

    function enterMultiple(uint _count) public{
        tokenAddress.transferFrom(msg.sender, address(this), rate*_count);
        uint count = _count + (_count * 10 / 100);
        for (uint i = 0; i < count ; i++){
            players.push(msg.sender);
        }
        addressToTicket[msg.sender] += count;
    }

    function pickWinner() public onlyOwner {
        require(players.length > 0, "There are no players");
        uint256 winnerIndex = random() % players.length;
        address winner = players[winnerIndex];
        uint winnings = tokenAddress.balanceOf(address(this))*75 / 100;
        tokenAddress.transfer(winner, winnings);
        delete players;
        lastWinner = winner;
    }

    function random() private view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp, players)));
    } //comment why its safe

    function setTokenAddress(address _USDC)external onlyOwner {
        tokenAddress = IERC20(_USDC);
    }    //sets tokenaddress which is used to pay with later

    function getPlayers() public view returns (address[] memory) {
        return players;
    }

    function setRate(uint newRate)external onlyOwner{
        rate = newRate*10**18;
    }

    function getBalanceOfContract()public view returns(uint){
        return tokenAddress.balanceOf(address(this));
    }

    function withdrawTreasury() external onlyOwner {
        tokenAddress.transfer(treasurer, tokenAddress.balanceOf(address(this)));
    }
}
